import styled from "styled-components";

const AssesStyle = {
    ContainerBidder: styled.div`
        max-width: 505px;
        max-height: 900px;
        border: solid 1px grey; 
    `,
    ContainerBtns: styled.div`
    padding-left: 120px;
    `,
    Btn: styled.button`
    margin: auto;
    padding: 10px;
    border-radius: 45px;
    background-color: #80808000;
    `
}

export default AssesStyle
